//제일 위에 보라색 nav bar 부분입니다.
import React, {useState} from 'react';
import styled from "styled-components";
import {Img, StyledButton} from "../components/BorrowBoard";
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
import { Layout, Menu, Button } from 'antd';
import {
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  UserOutlined,
  VideoCameraOutlined,
  UploadOutlined,
  AppstoreTwoTone,
  getTwoToneColor, setTwoToneColor,
  RightCircleTwoTone,
  LeftCircleTwoTone
} from '@ant-design/icons';
setTwoToneColor('#EBCAFD');
const { Header, Sider, Content } = Layout;
const { SubMenu } = Menu;
// nav 바를 감싸는 ul 태그 styled component 입니다.
const StyledNav=styled.ul` 
    height:120px;
    display:flex;
    align-items:center;
    justify-content:space-between;
    list-style:none;
    margin:0;
    padding:0 20px 0 20px;
    color: gray;
    font-size:15px;
    font-weight:bold;
    text-align: center;
    `;
;
const StyledTitle=styled.li`
    flex-basis: 80%;
`;
const StyledIcon=styled.li`
    flex-basis: 50px;
    white-space: nowrap;
`;
const StyledFirst=styled.li`
    flex-basis: 70px;
`;
// 통신을 위한 수정
const BoardNav = ({showAddress, login})=>{
    const [collapsed,setCollpased] = useState(false); 
    const toggle=()=>{
        setCollpased(!collapsed);
    };
    return(
        <div>
        <StyledNav>
        <Button type="primary" onClick={toggle} style={{ marginBottom: 16 }}>
          {React.createElement(collapsed ? LeftCircleTwoTone : RightCircleTwoTone)}
        </Button>
        <Menu
          defaultSelectedKeys={['1']}
          defaultOpenKeys={['sub1']}
          mode="inline"
          theme="dark"
          inlineCollapsed={this.state.collapsed}
        >
          <Menu.Item key="1" icon={<PieChartOutlined />}>
            Option 1
          </Menu.Item>
          <Menu.Item key="2" icon={<DesktopOutlined />}>
            Option 2
          </Menu.Item>
          <Menu.Item key="3" icon={<ContainerOutlined />}>
            Option 3
          </Menu.Item>
          <SubMenu key="sub1" icon={<MailOutlined />} title="Navigation One">
            <Menu.Item key="5">Option 5</Menu.Item>
            <Menu.Item key="6">Option 6</Menu.Item>
            <Menu.Item key="7">Option 7</Menu.Item>
            <Menu.Item key="8">Option 8</Menu.Item>
          </SubMenu>
          <SubMenu key="sub2" icon={<AppstoreOutlined />} title="Navigation Two">
            <Menu.Item key="9">Option 9</Menu.Item>
            <Menu.Item key="10">Option 10</Menu.Item>
            <SubMenu key="sub3" title="Submenu">
              <Menu.Item key="11">Option 11</Menu.Item>
              <Menu.Item key="12">Option 12</Menu.Item>
            </SubMenu>
          </SubMenu>
        </Menu>
            <StyledFirst><li></li></StyledFirst>
            <StyledTitle>
            <li><Img src="Img/logo.png" alt="로고" />
            <br/>{showAddress}
            </li>
            </StyledTitle>
            <StyledIcon>
                {login?
                (<li>
                <StyledButton><a href="/write"><Img src="img/plus.png" alt="글 등록"/></a></StyledButton>
                <StyledButton><a href="http://localhost:7000/auth/logout"><Img src="img/logout.png" alt="로그아웃"/></a></StyledButton>
                </li>)
                : 
                <a href = "/login"><StyledButton style={{marginRight:'30px',textAlign:'center',display:'flex',justifyContent:'space-evenly'}}><Img src="img/mypage.png" alt="로그인"/></StyledButton></a>
                }   
            </StyledIcon>
        </StyledNav>
        </div>
    );
};

export default BoardNav;
